import Link from 'next/link'

function HomePage() {
  return (
  	<div>
  		<h1>Welcome to Next.js!</h1>
  		<Link href="/blog">
  			<a>Blog</a>
  		</Link>
		<style jsx>{`
			h1 {
				font-size: 10rem;
			}
		`}</style>
  	</div>
  )
}

export default HomePage
